import React from "react";
import { Link } from "react-router-dom";
const tabsEvento = props => {
  return (
    <div className="container">
      <div className="card-panel z-depth-3">
        <ul className="tabs">
          <li className="tab col s6">
            <Link
              style={{ color: "blue" }}
              to="#"
              onClick={props.handleClickEvento}
              className="active"
            >
              Sobre o evento
            </Link>
          </li>
          <li className="tab col s6">
            <Link
              style={{ color: "blue" }}
              to="#"
              onClick={props.handleClickAtividades}
            >
              Atividades
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
};

export default tabsEvento;
